review:
1. Ткань очень тонкая; 
2. Разница с размерной сеткой продавца целых 4 см; 
3. Огромная затяжка на спине;
4. Криво сшитые рукава;
После открытия спора был вынесен вердикт: возврат товара, после чего будет полный возврат стоимости покупки. Естественно, стоимость пересылки в Китай ровно в два раза выше, чем стоимость самой водолазки. Следовательно, не имеет смысла. Вещь принесла сплошные разочарования...

Расстроена заказом по нескольким причинам:
1. Манжеты, воротник и нижняя резинка - просто РАСПУСКАЮТСЯ, они не обработаны и не закреплены;
2. нитки торчат ВЕЗДЕ и с изнаночной и с лицевой стороны;
3. боковые швы практически Не прошиты; 
4. рисунок на рукаве после локтя настолько стянут, что зажимает руку как в тиски;
5. свитер очень тонкий и совершенно не теплый (с этим могла бы смириться)
Товар НЕ соответствует заявленному , если некоторые нитки еще можно затянуть, и прошить боковые швы, но как обработать манжеты, воротник и низ резинки и что делать с тугим рукавом? Деньги выброшены ....Расстроена.
Продавец просто посоветовал " Свитер немного распустился- вы можете обработать его сами (the sweater has a little split,you can sew it by yourself )". Ну я могу и сама связать и перевязать, но за что тогда с меня берут деньги???? Открыла спор - деньги вернули.... НЕ РЕКОМЕНДУЮ !!!! ОСТЕРЕГАЙТЕСЬ ПОКУПАТЬ ТУТ!
